import { useState } from "react";

export default function Login(props) {
  const [userData, setUserData] = useState({
    email: "",
    password: "",
  });

  function handleChange(e) {
    const {name, value} = e.target;
    setUserData({
      ...userData,
      [name]: value
    });
  };

  function handleSubmit(e) {
    e.preventDefault();
    if (!userData.email || !userData.password) {
      return;
    }

  }

  return (
    <main>
      <h2 className="form__title form__title_type_login">Вход</h2>
      <form className="form" name="login" >
        <fieldset className="form__container">
          <input
            value={userData.email}
            id="name-input"
            name="name"
            type="text"
            className="form__item form__item_type_name"
            placeholder="Имя"
            required
            minLength="2"
            maxLength="40"
          />
          <span className="name-input-error form__item-error"></span>
          <input
            value={userData.password}
            id="metier-input"
            name="description"
            type="text"
            className="form__item form__item_type_metier"
            placeholder="О себе"
            required
            minLength="2"
            max="200"
          />
          <span className="metier-input-error form__item-error"></span>
        </fieldset>
      </form>
    </main>
  );
}
